pragma solidity >= 0.5.0;

contract ItemScore{

    uint [] userAnswer;
    uint [] valAnswer;
    uint userScore;
    uint valScore;

    struct User {
    uint id;
    string name; 
    uint userEstPoints;
    uint validEstPoints;
    bool set; // This boolean is used to differentiate between unset and zero struct values
    bool tokenEL;
    }



    mapping(address => User) public users;

    function newUser(address userAddress, uint userid, string memory username) public returns(bool) {
        users[userAddress].id = userid;
        users[userAddress].name = username;
        users[userAddress].set = true;
        return true;
    }
    function mappValueUser(address userAddress) public view returns(uint){
        return users[userAddress].userEstPoints;
    }
    function mappValueValidator(address userAddress) public view returns(uint){
        return users[userAddress].validEstPoints;
    }

    function user_Points(address userAddress, uint point) public returns(bool success){
        if(users[userAddress].set){
            userAnswer.push(point);
            return true;
        }
        
    }

    function userEstim(address userAddress) public returns(uint score){
        uint count = 0;
        userScore;
        if(users[userAddress].set){
            for(uint i = 0; i < userAnswer.length; i++){
                if(userAnswer[i] == 1){
                   count = count+1;
                }
            }
            userScore = count*10;
            users[userAddress].userEstPoints = userScore;
           delete userAnswer; 
        }
        return userScore;
    }

    function Validator_Points(address userAddress, uint point) public returns(bool success){
        if(users[userAddress].set){
            valAnswer.push(point);
            return true;
        }  
    }

    function valEstim(address userAddress) public returns(uint score){
        uint count = 0;
        valScore;
        // uint total_score;
        if(users[userAddress].set){
            for(uint i = 0; i < valAnswer.length; i++){
                if(valAnswer[i] == 1){
                   count = count+1;
                }
            }
            valScore = count*10;
            users[userAddress].validEstPoints = valScore;
            delete valAnswer;
        }
        return valScore;
    }

    // function compare(address userAddress) public returns(bool success){
    //     if(users[userAddress].userEstPoints == users[userAddress].validEstPoints){
    //         users[userAddress].tokenEL = true;
    //         return true;
    //     }
    // }
    function compare(address userAddress) public returns(bool success){
        if( userScore == valScore){
            users[userAddress].tokenEL = true;
            return true;
        }
    }
 
    
}

